import React, { Component } from 'react'
import "./selector.css"
export class Selector extends Component {

    filterSelection = (c) => {
        var x, i;
       x = document.getElementsByClassName("filter-item");
       console.log(x)
       if (c == "all") c = "";
       for (i = 0; i < x.length; i++) {
         this.RemoveClass(x[i], "show");
         if (x[i].className.indexOf(c) > -1) this.AddClass(x[i], "show");
       }
     }

    render() {


        return (
                <div className="ProjectsList">
                    <ul className="list">
                        <li onClick={() => this.filterSelection("all")} className="active"> All </li>
                        <li onClick={() => this.filterSelection("all")}>Welding</li>
                        <li>Machining</li>
                        <li>Enginering</li>
                     </ul>
                </div>
        )
    }
}

export default Selector
